import React from 'react'
import Fade from "react-reveal";

const About = () => {
  return (
    <div className='about'>
        <Fade duration={1000}>
            <div className='row'>
                <div className='nine columns main-col'>
                    <h2>About Me</h2>
                </div>
            </div>
        </Fade>

    </div>
  )
}

export default About
